import Login from './Pages/Authentication/Login';
import Register from './Pages/Authentication/Register';
import { Redirect, Switch, Route } from 'react-router-dom';

function App() {
  // const isLoggedIn = 
  return (
    <Fragment>
      {/* <h2>Hello World</h2> */}
      {/* <Navigation/> */}
      <Switch>
        <Route path='/'>
          <Redirect to='/login' />
        </Route>
        <Route path='/login'>
          <Login />
        </Route>
        <Route path='/register'>
          <Register />
        </Route>
      </Switch>

    </Fragment>
  );
}

export default App;
